import React from 'react';
import {Redirect, Route} from ' react-router-dom';

const PublicRoute = ({ component: Component, ...rest}) => {
    return (
        <Route
            {...rest}
            render={props => {
                return !getToken() ? <Component {...props} />
                : <Redirect to={{pathname: '/home'}} />
            }}
        />
    )
}

export default PublicRoute
